import React, { Component } from 'react';

class BoardDetail extends Component {
    constructor(){
        super();
        this.state = {
            images: []
        }
    }
    render(){
        // TAKE THIS AND MAKE IT THE IMG SRC

        const imagesList = this.props.boards.map((image) => {
            console.log(image.images, 'image.images')
            return (
                <div>
                    <img src={ image.images[0] } />
                    <img src={ image.images[1] } />
                    <img src={ image.images[2] } />
                </div>          
            )
        })
        console.log(imagesList)

        const boardsList = this.props.boards.map((board) => {
            return (
                <div key={ board._id } className="parent">
                    <div>{ board.title }</div>
                    <div>{ board.description }</div>
                    { imagesList }
                </div>
            )
        });   
        return(
            <div>
                <h1>BoardDetail</h1>
                <div>
                    { boardsList }
                    <div>
                    </div>
                </div>
            </div>
        )
    }
}

export default BoardDetail;
